import React from "react"

function Footer() {
    return (
    <div>
        <footer className="main-footer">
            <div className="content">
            <div class="circlelinkedin"><a href = "#"> < i class="fa fa-linkedin"></i> </a> </div>
            <div class="circleinsta"><a href = "#"> < i class="fa fa-instagram"></i> </a></div>
            <div className="about-us"><a href = "#"> About Us </a> </div>
            <div class= "contact-us"><a href = "#"> Contact Us </a> </div>
            </div>
        </footer>
    </div>
    )
}
export default Footer;
